/*Table structure for table `orders` */

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品id',
  `goods_name` varchar(50) DEFAULT NULL COMMENT '商品名',
  `goods_num` int(11) DEFAULT NULL COMMENT '商品数量',
  `goods_price` double DEFAULT NULL COMMENT '商品单价',
  `total_price` double DEFAULT NULL COMMENT '总价',
  `state` varchar(10) DEFAULT NULL COMMENT '订单状态',
  `address_id` int(11) DEFAULT NULL COMMENT '收货地址id',
  `address_name` varchar(200) DEFAULT NULL COMMENT '收货地址',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `user_name` varchar(50) DEFAULT NULL COMMENT '用户名',
  `insert_time` datetime DEFAULT NULL COMMENT '订单创建时间',
  `leave_msg` varchar(200) DEFAULT NULL COMMENT '用户留言',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

